import { FaRegWindowClose } from "react-icons/fa";
import { FaWindowClose } from "react-icons/fa";

const Todo = (todo_list) =>{
    return (
        <div className="todo">
            <div className="todo-container">
                <input type='checkbox'/>
                <h3>Task 1</h3>
                <FaRegWindowClose size='20px'/>
            </div>
       </div>
       )
    
}

export default Todo;
